import React from "react";
import "./Pages.css";

export default function Home() {
  return (
    <section className="page home-page">
      <h1>Welcome to Aki Battery Materials</h1>
      <p>
        Aki Battery Recycling is committed to sustainable battery recycling,
        producing black mass from lithium-ion battery waste to help close the
        loop in the EV supply chain.
      </p>
    </section>
  );
}
